INSERT INTO `room_type` VALUES (1,'2D','Phòng chiếu phim tiêu chuẩn 2D với chất lượng hình ảnh sắc nét và hệ thống âm thanh vòm kỹ thuật số, mang lại trải nghiệm xem phim chân thực, quen thuộc.'),(2,'4DX','Phòng chiếu đa giác quan với hiệu ứng chuyển động của ghế, kết hợp các yếu tố môi trường như gió, nước, mùi hương và ánh sáng, giúp khán giả \"sống\" cùng bộ phim.'),(3,'BEDOM','Phòng chiếu giường nằm đôi cao cấp (Bedroom Cinema), mang đến sự thoải mái tối đa và riêng tư, lý tưởng cho các cặp đôi hoặc những buổi xem phim thư giãn tuyệt đối.'),(4,'SUPER CLASS','Phòng cao cấp với ghế da VIP rộng rãi, có thể điều chỉnh và đi kèm dịch vụ tận tình. Cung cấp không gian riêng tư và trải nghiệm xem phim đẳng cấp, sang trọng.'),(5,'IMAX','Phòng chiếu màn hình lớn khổng lồ. Nổi bật với độ phân giải hình ảnh cực cao và hệ thống âm thanh vòm đa chiều mạnh mẽ, mang lại cảm giác đắm chìm tuyệt đối điện ảnh.');
/*!40000 ALTER TABLE `room_type` ENABLE KEYS */;
UNLOCK TABLES;

